import java.util.Arrays;

public class NewSort {

	public void ns(int[] arr) {
		Arrays.sort(arr);
	}

	
	
	
	
	
	
	
	
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		NewSort s = new NewSort();
		int[] a = {1,3,4,5,7,2,8,9,123,345,678};
		s.ns(a);

	}

}
